import React from "react";
import { View } from "react-native";
import IntakeForm from "./IntakeForm";

import Navigation from "./Navigation";


const IntakeScreen = ({ route }) => {
  return (
      <View style={{
          display: 'flex'
      }}>
          <Navigation />
          <IntakeForm />
      </View>
  );
};

export default IntakeScreen;
